import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';
import Modal from 'react-modal';
import CustomerModal from 'components/Modal.js';

import {
    Button,
    FormGroup,
    Input,
    Container,
    Row,
    Col,
    Card,
    CardBody,
    CardImg,
    CardTitle,
    CardText
} from "reactstrap";
import { collapseTextChangeRangesAcrossMultipleVersions } from 'typescript';

class Cars extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            posts: [],
            catalogue: Array(),
            loading: true,
            error: null
        };
    }


    componentDidMount() {
        // Remove the 'www.' to cause a CORS error (and see the error state)
        const catalogue = Array()
        axios.get("http://desmond.business:8080/fyp/getBiddings")
            .then(res => {
                // Transform the raw data by extracting the nested posts

                const posts = res.data.results;
                for (let index = 0; index < 10; index++) {
                    catalogue.push(
                        <Card style={{ width: '20rem' }}>
                            <CardImg top src={require("assets/img/mac_apple.jpg")} alt="..." />
                            <CardBody>
                                <CardTitle>{posts[index].title}</CardTitle>
                                <CardText>{posts[index].create_timestamp}</CardText>
                                <Button color="primary">${posts[index].selling_price}</Button>
                            </CardBody>
                            </Card>
                    )
                }
                console.log(catalogue);
                //console.log(posts);
                // Update state to trigger a re-render.
                // Clear any errors, and turn off the loading indiciator.
                this.setState({
                    posts,
                    catalogue: catalogue,
                    loading: false,
                    error: null
                });
            })
            .catch(err => {
                // Something went wrong. Save the error in state and re-render.
                this.setState({
                    loading: false,
                    error: err
                });
            });
    }

    renderLoading() {
        return <div>Loading...</div>;
    }

    renderError() {
        return (
            <div>
                Uh oh: {this.state.error.message}
            </div>
        );
    }

    renderPosts() {
        if (this.state.error) {
            return this.renderError();
        }

        console.log(this.state.posts[0]);
        return (
            <h6>
                Success getting Bidding Records
            </h6>
            
        );
    }

    render() {
        const catalogue = this.state.catalogue

        return (

            <div className="section">

                <Container className="text-center">
                    <Card className="text-center">
                        <CardBody>
                            <Row>
                                {catalogue};
                                <div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>
                                <Card style={{ width: '20rem' }}>
                                    <CardImg top src={require("assets/img/mac_apple.jpg")} alt="..." />
                                    <CardBody>
                                        <CardTitle>title</CardTitle>
                                        <CardText>create_timestamp</CardText>
                                        <Button color="primary">$selling_price</Button>
                                    </CardBody>
                                </Card>
                                <div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>
                                <Card style={{ width: '20rem' }} className="text-center">
                                    <CardImg top src={require('assets/img/benz.png')} alt="..." />
                                    <CardBody>
                                        <CardTitle>Benz</CardTitle>
                                        <CardText>Sell it quicky, dont think</CardText>
                                        <CardText>Used 10 years, 99% new</CardText>
                                        <Button color="primary">$1200</Button>
                                    </CardBody>
                                </Card>
                                <div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>
                                <Card style={{ width: '20rem' }} className="text-right">
                                    <CardImg top src={require('assets/img/aeroplane.jpg')} alt="..." />
                                    <CardBody>
                                        <CardTitle>Aeroplane</CardTitle>
                                        <CardText>Have you tried buying an aeroplane ?</CardText>
                                        <Button color="primary">$12M ( $12000000 )</Button>
                                    </CardBody>
                                </Card>
                                <div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>
                                <Col className="ml-auto mr-auto text-center" md="8">
                                </Col>
                            </Row>
                        </CardBody>
                    </Card>
                </Container>
            </div>
        );
    }
}

export default Cars;
